\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhile science, medicine, art, poetry, architecture, chess, space, sports, number theory and all things hard and beautiful promise purity, elegance and sometimes even transcendence, they are fundamentally subordinate. In the end, they must bow to the sovereignty of politics.\n\nNovember 2, 2014\n\u001c8\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cGet your politics wrong, however, and everything stands to be swept away. This is not ancient history. This is Germany 1933.\n\nJune 13, 2017\n\u001c8\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI must study politics and war,” wrote John Adams, “that my sons may have the liberty to study mathematics and philosophy, geography, natural history, and naval architecture, navigation, commerce, and agriculture, in order to give their children a right to study painting, poetry, music, architecture, statuary, tapestry and porcelain.”\n\nNovember 2, 2014\n\u001c10\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cyet the glories yielded by such a successful politics lie outside itself. Its deepest purpose is to create the conditions for the cultivation of the finer things, beginning with philosophy and science, and ascending to the ever more delicate and refined arts.\n\nNovember 2, 2014\n\u001c10\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhile political practice deserves grudging respect for its power, political philosophy commands reverence for its capacity for grandeur and depth, as exemplified in the sublime texts of the American founding. Accordingly, I have weighted much of the politically oriented writings in this volume toward those dealing with constitutional issues and general principles.\n\nNovember 2, 2014\n\u001c11\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt is a measure of its improbability that until age 30, I had not the faintest idea or expectation of becoming a writer. I had a brief accidental stint in college, then quite casually left it behind for a decade, only to return to it by the sheerest serendipity.\n\nNovember 2, 2014\n\u001c12\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJohn Stuart Mill, whose On Liberty is the foundational document of classical liberalism. To this day it is the first thing I recommend to any young person seeking political guidance, to be followed by Isaiah Berlin’s Four Essays on Liberty, perhaps the finest, and surely the most accessible, 20th-century elaboration of that tradition.\n\nNovember 2, 2014\n\u001c13\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI remain forever respectful of the work carried on by my colleagues and grateful for my own seven years there. Medicine—and particularly hospital medicine, which lives in a sea of human suffering—has a way of beating callowness out of even the most self-possessed youth. Its other invaluable residue is best described by Arthur Conan Doyle, himself a physician: “The moral training to keep a confidence inviolate, to act promptly on a sudden call, to keep your head in critical moments, to be kind yet strong—where can you, outside medicine, get such a training as that?”\n\nNovember 2, 2014\n\u001c16\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNonetheless, my life as a doctor felt constricted. It was conducted entirely within the four walls of the hospital. Outside, there was a history unfolding to which I felt impelled to contribute—but saw no way to. How to get from here to there?\n\nNovember 2, 2014\n\u001c16\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNot so on domestic policy. The Democratic Party remained true to itself. I changed. The origin of that evolution is simple: I’m open to empirical evidence. The results of the Great Society experiments started coming in and began showing that, for all its good intentions, the War on Poverty was causing irreparable damage to the very communities it was designed to help.\n\nNovember 2, 2014\n\u001c20\n\u0011\n\u0011\n\n\nPart One: Personal\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMarcel’s left arm is draped around my neck with that effortless natural easefulness—and touch of protectiveness—that only older brothers know. Whenever I look at that picture, I know what we were thinking at the moment it was taken: It will forever be thus. Ever brothers. Ever young. Ever summer. My brother Marcel died on Tuesday, January 17. It was winter. He was 59.\n\nBe a better older bro to Bo. And to Dom. And to Luke. I wonder if my nurture wall still exists\n\nNovember 2, 2014\n\u001c27\n\u0011\n\u0011"},{"ty":"ae","et":"inline","id":"i.0","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":105.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":150.9375,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":"Cover Image","i_cid":"1OxVcMQClG9-mlinhqdulzVQllCLsJZLO3eF0lJI","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.1","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"1_B5ddrLjSfLmj7JirwoNayIvbOPmvnyzKvBvWoc","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.10","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo