bBlcjK53exI">DOCS_modelChunk = [{"ty":"is","ibi":4382,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNo. The originality of the 20th surely lay in its politics. It invented the police state and the command economy, mass mobilization and mass propaganda, mechanized murder and routinized terror—a breathtaking catalog of political creativity.\n\nNovember 2, 2014\n\u001c30\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cheard of a promising young mathematician who wanted to go to Harvard but was short the money needed. Erdos arranged to see him and lent him $1,000. (The sum total of the money Erdos carried around at any one time was about $30.) He told the young man he could pay it back when he was able to. Recently, the young man called Graham to say that he had gone through Harvard and now was teaching at Michigan and could finally pay the money back. What should he do? Graham consulted Erdos. Erdos said, “Tell him to do with the $1,000 what I did.”\n\nNovember 2, 2014\n\u001c33\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cno one knows why Hobbs is shot. It is fate, destiny, nemesis. Perhaps the dawning of knowledge, the coming of sin. Or more prosaically, the catastrophe that awaits everyone from a single false move, wrong turn, fatal encounter. Every life has such a moment. What distinguishes us is whether—and how—we ever come back\n\nNovember 2, 2014\n\u001c36\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHe was a rare specimen of what used to be called a humanist: His mastery of science was complemented by deep knowledge of the humanities. With his supple and sophisticated mind, he discoursed easily on art, literature, politics, history.\n\nNovember 2, 2014\n\u001c40\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHermann did all this quietly, without fanfare. At graduation, he took not only pride but a kind of mischievous delight in our unspoken conspiracy. We broke no rules, but we bent a few, especially the stupid ones. I’m sure he liked that.\n\nNovember 2, 2014\n\u001c41\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI say we keep the big ones for ourselves—laser-guided munitions, Google, Warren Buffett—and let the rest of the world have ice hockey, ballroom dancing and every Nobel Peace Prize. And throw in the Ryder Cup. I always root for the Europeans in that one. They lost entire empires, for God’s sake; let them have golf supremacy for one weekend. No one likes an Oswald.\n\nNovember 2, 2014\n\u001c46\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSome will protest that in a world with so much human suffering, it is something between eccentric and obscene to mourn a dog. I think not. After all, it is perfectly normal—indeed, deeply human—to be moved when nature presents us with a vision of great beauty. Should we not be moved when it produces a vision—a creature—of the purest sweetness?\n\nNovember 3, 2014\n\u001c67\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTo understand the workings of American politics, you have to understand this fundamental law: Conservatives think liberals are stupid. Liberals think conservatives are evil.\n\nNovember 3, 2014\n\u001c71\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cLiberals believe that human nature is fundamentally good. The fact that this is contradicted by, oh, 4,000 years of human history simply tells them how urgent is the need for their next seven-point program for the social reform of everything. Liberals suffer incurably from naïveté, the stupidity of the good heart.\n\nNovember 3, 2014\n\u001c71\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThere could be no greater irony: For all the sublimity of art, physics, music, mathematics and other manifestations of human genius, everything depends on the mundane, frustrating, often debased vocation known as politics\n\nNovember 3, 2014\n\u001c137\n\u0011\n\u0011\n\n\nPart Two: Political\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut the most formative, most important influence on the individual is not government. It is civil society, those elements of the collectivity that lie\n\nNovember 3, 2014\n\u001c143\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cfamily, neighborhood, church, Rotary club, PTA, the voluntary associations that Tocqueville understood to be the genius of America and source of its energy and freedom.\n\nNovember 3, 2014\n\u001c143\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cLimited government so conceived has two indispensable advantages. It avoids inexorable European-style national insolvency. And it avoids breeding debilitating individual dependency. It encourages and celebrates character, independence, energy, hard work as the foundations of a free society and a thriving economy—precisely the virtues Obama discounts and devalues in his accounting of the wealth of nations.\n\nNovember 3, 2014\n\u001c145\n\u0011\n\u0011"},{"ty":"te","id":"i.12","spi":4391},{"ty":"te","id":"i.13","spi":4669},{"ty":"te","id":"i.14","spi":5248},{"ty":"te","id":"i.15","spi":5602},{"ty":"te","id":"i.16","spi":5877},{"ty":"te","id":"i.17","spi":6151},{"ty":"te","id":"i.18","spi":6554},{"ty":"te","id":"i.19","spi":6937},{"ty":"te","id":"i.20","spi":7148},{"ty":"te","id":"i.21","spi":7501},{"ty":"te","id":"i.22","spi":7783},{"ty":"te","id":"i.23","spi":7972},{"ty":"te","id":"i.24","spi":8179},{"ty":"as","st":"paragraph","si":4382,"ei":4382,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":4383,"ei":4383,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"