,"ts_bgc_i":false}},{"ty":"as","st":"text","si":7938,"ei":7955,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":7975,"ei":8144,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":8145,"ei":8162,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":8182,"ei":8591,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":8592,"ei":8609,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="auEYSX6yE4UDt8zabBlcjK53exI"  nonce="auEYSX6yE4UDt8zabBlcjK53exI">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="auEYSX6yE4UDt8zabBlcjK53exI"  nonce="auEYSX6yE4UDt8zabBlcjK53exI">DOCS_modelChunk = [{"ty":"is","ibi":8617,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSen. John Danforth of Missouri recalls that in his first Senate race in 1970, he ran against the popular Stuart Symington and lost. Yet both ran such positive and honorable campaigns that Danforth ended up one of best-liked politicians in Missouri. Six years                                         \n\nNovember 3, 2014\n\u001c153\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001clater he ran again and won\n\nNovember 3, 2014\n\u001c153\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cpoliticians have since “gone negative.” The reason is simple. Negative works. It gets individuals elected. Add up all the individual acts of political homicide, however, and you have a political class that is collectively committing suicide.\n\nNovember 3, 2014\n\u001c153\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cychiatrist in Massachusetts in the 1970s, I committed people—often right out of the emergency room—as a danger to themselves or to others. I never did so lightly, but I labored under none of the crushing bureaucratic and legal constraints that make involuntary commitment infinitely more difficult today. Why do you think we have so many homeless? Destitution? Poverty has declined since the 1950s. The majority of those sleeping on grates are mentally ill. In the name of civil liberties, we let them die with their rights on.\n\nNovember 4, 2014\n\u001c167\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA tiny percentage of the mentally ill become mass killers. Just about everyone around Tucson shooter Jared Loughner sensed he was mentally ill and dangerous. But in effect, he had to kill before he could be put away—and (forcibly) treated.\n\nNovember 4, 2014\n\u001c168\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cRandom mass killings were three times more common in the 2000s than in the 1980s, when gun laws were actually weaker. Yet a 2011 University of California at Berkeley study found that states with strong civil\n\nNovember 4, 2014\n\u001c168\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ccommitment laws have about a one-third lower homicide rate.\n\nNovember 4, 2014\n\u001c168\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhile law deters the rational, it has far less effect on the psychotic. The best we can do is to try to detain them, disarm them and discourage “entertainment” that can intensify already murderous impulses.\n\nNovember 4, 2014\n\u001c168\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut there’s a cost. Gun control impinges upon the Second Amendment; involuntary commitment impinges upon the liberty clause of the Fifth Amendment; curbing “entertainment” violence impinges upon First Amendment free speech.\n\nNovember 4, 2014\n\u001c169\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThat’s a lot of impingement, a lot of amendments. But there’s no free lunch. Increasing public safety almost always means restricting liberties. We made that trade after 9/11. We make it every time the Transportation Security Administration invades your body at an airport. How much are we prepared to trade away after Newtown?\n\nNovember 4, 2014\n\u001c169\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cGeorge Bush is the first president to approve federal funding for stem cell research. There are 22 lines of stem cells now available, up from one just two years ago.\n\nNovember 4, 2014\n\u001c193\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFor the purposes of a pluralist society, the Bible is not about fact. It is about values. If we were a bit more tolerant about allowing the teaching of biblical values as ethics, we’d find far less pressure for the teaching of biblical fables as science.\n\nNeed to keep this is mind regarding shinnyoen. We r teaching values, not fact that if u r a follower, certain things r open to u...\n\nNovember 4, 2014\n\u001c219\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhether it comes from church teaching, inner conviction or some trash novel, the legitimacy of any belief rests ultimately on its content, not on its origin.\n\nYushin mindset needs to be well thought out. In writing. So people can judge it based on its content, not it\u0027s origin.\n\nNovember 4, 2014\n\u001c221\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMoreover, it is particularly hypocritical for liberals to profess outrage at the involvement of the Catholic Church in this political issue, when only a few decades ago much of the civil rights and antiwar movements was run out of the churches. When Martin Luther King Jr. invoked scripture in support of his vision of racial equality\n\nNovember 4, 2014\n\u001c222\n\u0011\n\u0011"},{"ty":"te","id":"i.25","spi":8626},{"ty":"te","id":"i.26","spi":8964},{"ty":"te","id":"i.27","spi":9029},{"ty":"te","id":"i.28","spi":9309},{"ty":"te","id":"i.29","spi":9875},{"ty":"te","id":"i.30","spi":10153},{"ty":"te","id":"i.31","spi":10399},{"ty":"te","id":"i.32","spi":10497},{"ty":"te","id":"i.33","spi":10742},{"ty":"te","id":"i.34","spi":11004},{"ty":"te","id":"i.35","spi":11370},{"ty":"te","id":"i.36","spi":11574},{"ty":"te","id":"i.37","spi":12000},{"ty":"te","id":"i.38","spi":12316},{"ty":"as","st":"paragraph","si":8617,"ei":8617,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":8618,"ei":8618,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":8619,"ei":8619,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":8621,"ei":8621,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":8623,"ei":8623,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.