American identity entitles me to certain corporate privileges: life, liberty, happiness pursued, columns uncensored. These benefits I receive wholly undeserved. They are mine by accident of birth. So are America’s debts. I cannot claim one and disdain the other. During the centuries of slavery in America, my ancestors were being chased by unfriendly authorities across Eastern Europe. I feel, and bear, no guilt for the plight of blacks. But America’s life is longer than mine. America has sins, and obligations that flow from those sins. To be American today is to share in those obligations.\n\nNovember 4, 2014\n\u001c247\n\u0011\n\u0011"}
